    type: "ADD_CART",
    data,
  };
};

export const updateCart = (data) => {
  return {
    type: "UPDATE_CART",
    data,
  };
};

export const deleteCart = (data) => {
  return {
    type: "DELETE_CART",
    data,
  };
};
